import './App.css';

function App() {
  function sum(a) {
    let currentSum = a;

    function f(b) {
        // if(!b) {
          // console.log('end');
        // }
        currentSum += b;
        return f;
    }

    f.toString = function() {
        return currentSum;
    }

    return f;
  }

  alert(sum(1)(2)(5))
  // console.log();

